import React from "react";
import axios from "axios";

export default class SongList extends React.Component {
  state = {
    persons: [],
  };

  componentDidMount() {
    axios
      .get(
        `https://www.abbreviations.com/services/v2/lyrics.php?uid=7926&tokenid=f0ZBfcDiL9WPYeCR&term=forever%20young&format=json`
      )
      .then((res) => {
        console.log(res);
        this.setState({ persons: res.data });
      });
  }

  render() {
    return (
      <ul>
        {this.state.persons.map((person) => (
          <li key={person.artist}>{person.song}</li>
        ))}
      </ul>
    );
  }
}
